import Card from './Card';

function Cards({courses}){

    let allcourses = [];

    function getCourses(){
        Object.values(courses).forEach((courseCategory) => {
            courseCategory.forEach((course) => {
                allcourses.push(course);
            });
        })
    }

    return(
        <div>
            {courses.map((data) => (
                <Card key={data.id}>{data.title}</Card>
            ))}
        </div>
    )

}

export default Cards;
